import { Link, useLocation } from "react-router-dom";

import useFetch from "../components/useFetch";

const Blogs = () => {
    // Fetch Menu Data 
    const {data: blogs, isPending, error} = useFetch("http://localhost:4000/blogsDetails");

    // Styles 
    let blogsContainer = {
        display: "flex",
        flexDirection: "column"
    } 

    return (
    <section className="blogs">
        <div className="container">
            <div className="head">
                <h1>
                    Our <span>Blogs</span>
                </h1>
            </div>
            
        </div>
    </section>
    );
}

export default Blogs;
